            <div className="providers-items inner-flex">
                <a className='provider-item' href='' id=''>
                  <img src="https://api.adkey-seo.com/storage/images/providers/" alt='' title=''/>  
                </a>
            </div>
        </div>
      </section>
    )
  }
}
